import React from 'react'

export default function CardAbout() {
    return (
        <div className="relative w-[1146px] h-[536px] top-[350px]">
            {/* Small Positioned Box (Decoration/Future Content) */}
            <div className="absolute w-[100px] h-[116px] left-[338px] top-[420px]"/>

            {/* Main Image and Overlays */}
            <div className="absolute w-full h-[495px] top-0 flex">
                <div className="relative w-[754px] h-full ml-auto">
                    <div className="absolute inset-0 bg-[#0594ff] opacity-10 shadow"/>
                    <div className="absolute inset-0 bg-[#0594ff]"/>
                    <img
                        className="absolute inset-0 w-full h-[518px] object-cover"
                        src=""
                        alt=""
                    />
                </div>
            </div>

            {/* Text and Blur Overlay Section */}
            
        </div>

    )
}
